DROP DATABASE IF EXISTS MeSocorreAe;

CREATE DATABASE MeSocorreAe
DEFAULT CHARSET utf8mb4
COLLATE utf8mb4_general_ci;

USE MeSocorreAe;

CREATE TABLE Estados (
	pk_cod TINYINT(2) UNSIGNED NOT NULL UNIQUE AUTO_INCREMENT,
	nome VARCHAR(70) NOT NULL,
    uf CHAR(2) NOT NULL,
    PRIMARY KEY (pk_cod)
);

CREATE TABLE Cidades (
	pk_cod SMALLINT(4) UNSIGNED NOT NULL UNIQUE AUTO_INCREMENT,
    nome VARCHAR(70) NOT NULL,
    fk_estado TINYINT(2) UNSIGNED NOT NULL,
    PRIMARY KEY (pk_cod),
    FOREIGN KEY (fk_estado) REFERENCES Estados(pk_cod)
);

CREATE TABLE Categorias (
	pk_cod SMALLINT(4) UNSIGNED UNIQUE NOT NULL AUTO_INCREMENT,
    nome VARCHAR(50) UNIQUE NOT NULL,
    PRIMARY KEY (pk_cod)
);

CREATE TABLE Usuarios (
	pk_cpf BIGINT(11) ZEROFILL UNSIGNED UNIQUE NOT NULL,
    email VARCHAR(50) UNIQUE NOT NULL,
    tipo CHAR(1) NOT NULL,
    status char(1) NOT NULL,
    fk_categoria SMALLINT(4) UNSIGNED,
    foto_perfil MEDIUMBLOB,
    nome VARCHAR(50) NOT NULL,
    senha VARCHAR(20) NOT NULL,
    data_nasc DATE NOT NULL,
    telefone BIGINT(11) UNSIGNED,
    fk_cidade SMALLINT(4) UNSIGNED,
    end_rua VARCHAR(100),
    end_numero INT(6) UNSIGNED,
    end_bairro VARCHAR(40),
    end_complemento VARCHAR(70),
    end_cep BIGINT(8) UNSIGNED,
    descricao TEXT,
    PRIMARY KEY (pk_cpf),
    FOREIGN KEY (fk_categoria) REFERENCES Categorias(pk_cod),
    FOREIGN KEY (fk_cidade) REFERENCES Cidades(pk_cod)
);

CREATE TABLE Servicos (
	pk_cod BIGINT(9) UNSIGNED NOT NULL UNIQUE AUTO_INCREMENT,
    situacao CHAR(1) NOT NULL,
    descricao TEXT NOT NULL,
    fk_cliente BIGINT(11) ZEROFILL UNSIGNED NOT NULL,
    fk_autonomo BIGINT(11) ZEROFILL UNSIGNED NOT NULL,
    preco DECIMAL(10,2) UNSIGNED,
    data_hora_reg DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    data_hora_qua DATETIME NOT NULL,
    nota TINYINT(1) UNSIGNED,
    opiniao TEXT,
    resposta TEXT,
    PRIMARY KEY (pk_cod),
    FOREIGN KEY (fk_cliente) REFERENCES Usuarios(pk_cpf),
    FOREIGN KEY (fk_autonomo) REFERENCES Usuarios(pk_cpf)
);



    

